import { StatusBar } from "expo-status-bar";
import { createAppContainer } from "react-navigation";
import { createStackNavigator } from "react-navigation-stack";
import React from "react";
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import {
  StyleSheet,
} from "react-native";

import DeliveriesScreen from "./DeliveriesScreen";
import HistoryScreen from "./HistoryScreen";

const Tab = createBottomTabNavigator();

const TabNavigationView = () => {
  return(
    <Tab.Navigator initialRouteName='Requests' screenOptions={{ headerShown: false }}  >
      <Tab.Screen name="Deliveries" component={DeliveriesScreen} />
      <Tab.Screen name="History" component={HistoryScreen} />
    </Tab.Navigator>
  )
}


const Stack = createNativeStackNavigator();

const HomeScreen = ({navigation}) => {

  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName='Menus' screenOptions={{ headerShown: false }} >
        <Stack.Screen name='Menus' component={TabNavigationView} />
      </Stack.Navigator>
    </NavigationContainer>
  );


};

export default HomeScreen;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
